  {rentalgeek_property_manager_id: 1237, rentalgeek_id: 11309, latitude: 38.9701991, longitude: -95.2853184, allows_cats: true, allows_dogs: true, name: "Canyon Court", url: "http://firstmanagementinc.com/find-an-apartment/lawrence-kansas/canyon-court/", full_address: "700 Comet Lane, Lawrence, KS 66049", customer_contact_email_address: "canyoncourt@sunflower.com", customer_contact_phone_number: 7858321746, salesy_description: "Canyon Court was planned with excellence in mind. Beautiful architecture combined with attractive amenities blend to create the ideal living enviroment.\r\nCanyon Court offers first class apartments with many upgrades and amenities including fitness center, basketball court, pool, and spa. Expect excellence at Canyon Court!"},
  {rentalgeek_property_manager_id: 1237, rentalgeek_id: 11312, latitude: 38.94817, longitude: -95.258551, allows_cats: true, allows_dogs: true, name: "Chase Court", url: "http://firstmanagementinc.com/find-an-apartment/lawrence-kansas/chase-court/", full_address: "1942 Stewart Avenue, Lawrence, KS 66046", customer_contact_email_address: "chasecourt@sunflower.com", customer_contact_phone_number: 7858438220, salesy_description: "If you are looking for a first class living environment, Chase Court is your solution! Built in 2002, our luxury one and two bedroom apartments provide the ultimate in quality, space, and affordability. Our homes are fully equipped with top-notch washers, dryers, and kitchen appliances.\r\n\r\nEnjoy luxury living by using our on-site 24 hour work-out facility, relaxing poolside, or watching free DVDs from our extensive collection. Residents who are students are within short walking distance of campus and can also take advantage of the university bus stop located conveniently outside the Chase Court clubhouse on Stewart Avenue."},
